import React, { useEffect } from "react";
import { Navigate } from "react-router";

function Protected(props){
    const {Component} = props
    useEffect(()=>{
        let login = localStorage.getItem("login");
        const navigate = Navigate();
        if(!login){
            navigate("/login")
        }
    })
    return(
        <>
           <Component/>
        </>
    )
}


export default Protected;
